import React from 'react';
import { FirstName , LastName } from './App'
function ComC(){
  return (
    <>
    <FirstName.Consumer>
    {function (fname){
      return ( 
      <LastName.Consumer>
        {function (lname){
          return <h1>Hello , Welcome in {fname} {lname}</h1>
        }}
      </LastName.Consumer>
      )
    }}
    
    </FirstName.Consumer>
    </>
  )
}


export default ComC;
